import React, {Component} from 'react'

import classes from './Wheel.css'

export default class Wheel extends Component {
    render(){
        console.log(classes.Wheel)
        return (
            <h1 className={classes.Wheel}>
                Hello wordl!
            </h1>
        )
    }
}
